import React, { Component } from 'react';
import {FaLogIn} from 'react-icons/fa';
import { FaUsers } from 'react-icons/fa';
import { MdPhoneIphone } from 'react-icons/md';
import { HiMail } from 'react-icons/hi';

class TopNavRightIcon extends Component {
    
    render() {
        return (
       <ul class="list-inline2">
            <li>
                <div className='select'>
                        <a href="login.html" title="register" target="_blank">Login<FaLogIn /></a>
                    <a href="register.html" title="register" target="_blank">Join<FaUsers/></a>
                </div>
            </li>
            <li>
                <a href="tel:01028496209" title="Call me" target="_blank" class="mobile">01028496209<MdPhoneIphone/></a>
            </li>
            <li>
                <a href="mailto:info@yourdomain.com" title="Mail" target="_blank">info@yourdomain.com<HiMail/></a>
            </li>
        </ul>
    );
    }
};

export default TopNavRightIcon;
